import React from 'react'; 
import { motion, useScroll } from 'framer-motion';
import { useNavigate } from 'react-router-dom';

const Error = () => {

    const handleClick = async () => {
        try {
        console.log("clicked");
        navigate('/');
        // navigate('/stats', { state: { selectedYear, stats: data } });
        } catch (error) {
        console.log(error);
        }
    };

    return (
        <div className="flex flex-col items-center justify-center h-screen"
        style={{
        backgroundColor:'rgb(255, 254, 247)',
        height: 'calc(100vh - 80px)' 
        }}>
        <header className="text-center py-8">
        <h1 className="text-5xl font-bold">
            <h2 className="title">you've encountered an error. let's get you back<br /></h2>
            <ReactTyped strings={["on track"]} typeSpeed={100} loop={false} />
        </h1>
        </header>
        <motion.button
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.9 }}
            onClick={handleClick}
            className="bg-lightblue text-white font-wotfard text-l py-2 px-4 rounded mt-4"
        >
            back to home
        </motion.button>
        </div>
    );
}

export default Error;
